('node', 'city', 0, 77, 77, 'und', 0, '<p><strong>Lviv, a city in western Ukraine, is regarded as one of the main cultural centers of Ukraine. In 2009 it&nbsp;has been recognized as the cultural capital of Ukraine.</strong></p><p>On the 28th of April 2009, Lviv has been recognized as the cultural capital of Ukraine. This status award was given based on expert research of The State service of tourism and resorts and &ldquo;The Council on tourism and resorts issues&rdquo;. The main reasons of such obtaining is the conducting of more than 100 festivals annually, 60 museums, 100 churches of different confessions, and the big tourist interest in Lviv.</p><p>For the past 2 years the tourist stream to the city increased by 40 %, and now it is more than a million people per year.</p><p>Among the foreigners, the biggest amount of tourists come from Poland, Germany, Austria, Belarus, USA and Russia.</p><p>The city is known as a center of art, literature, music and theatre. Nowadays, the indisputable evidences of the city cultural richness is a big number of theaters, concert halls, creative unions, and also high number of many artistic activities. Temples, frescos, paintings, traditions, feasts, festivals &ndash; all these are the heirdom of the past and the product of the present geniuses, which can be felt only in Lviv.</p><p>Due to the rich cultural programme, developed infrastructure (now Lviv has more than 8 000 hotel rooms, over 700 caffees and restaurants, free WI-Fi zones in the city centery, good connection with many countries of the world) Lviv has the biggest tourist potential in Ukraine.</p><p>Lviv is also a huge educational center with 23 educational institutions, 7 of which prepares support staff for tourism infrastructure.</p><p>According to the statics, more than 10 thousand tourists come to each city festival.</p><p>Lviv has established many city-feasts, such as Coffee and Chocolate feasts, the feast of pampukh, The Day of Batyar, such festivals as &ldquo;Ethnovyr&rdquo;, &ldquo;Krayina Mriy&rdquo;, international theatrical festival &ldquo;Golden Lion&rdquo;.</p><p>Lviv is the city, where festivals and concerts are being held every week.</p>', '', 'full_html'),
('node', 'city', 0, 78, 78, 'und', 0, '<p>Odesa is a very special city since it&rsquo;s foundation. It was always the mixture of the lot of nationalities, for example, at the present more than 1.000.000 people represent 135 nations from all around the World! Such a mixture was the reason that made this city became very cosmopolitan, where each guest is always welcome and people are friendly and simple. There are also very undertaking and businesslike, creative and practical.</p><p>The fact that Odessa is located at the Black Sea shores made it very attractive as the vacation place still since its foundation at 1794. The Sea Port is located at the central part of the city, but aside of the Port there is a long line of beaches that length at its both sides to the end of this big city.</p><p>Since a lot of guests traditionally were coming to this city for vacation, Odesa developed a huge tourist infrastructure, restaurants, discos, night clubs, hotels, theaters, etc.</p><p>Where all these people stay when they come to Odesa? Since Soviet times Odesa had a few hotels of the questionable quality and services. However since 1991 when Ukraine started the new way of life, things has been changed dramatically. New big and small hotels of different classes were built as well as private apartments rent business developed extensively.</p><p>Odesa is not only an ideal place to rest, but it is also a city rich in natural and cultural resources. The best way to familiarize oneself with Odesa&rsquo;s splendid architecture, breathtaking views and fantastic monuments is by walking around its historic center. Odesa is a city that is not easily forgotten. Its snow-white yachts, golden beaches, lush green gardens, and the bluest waters, cling to the heart and fill each visitor with an overwhelming desire to return to the beautiful Odesa.</p>', '', 'full_html'),
('node', 'city', 0, 79, 79, 'und', 0, '<p>The history of Kharkiv city has almost 360 years and you can`t say it`s not enough. Rumor has it city started from phenomena of Wild Field or Dike pole where nomads lived for long time before Catherine II ordered to found the city of Kharkiv. There are few variants of the city name origin. One of it says Kharkiv was named on behalf Cossack Kharko, and his monument is standing on Lenin Avenue &ndash; one of the main streets. The other one is more reliable and says the city was named for the river &ndash; the name was given by Tatar tribes &ndash; and really the name of river Kharkiv found on maps of the Russian Empire long before the founding of the city.</p><p>A lot of water has flow under the bridge and Kharkiv has grown to second biggest city in Ukraine and even for few years it was the first capital of Ukrainian Soviet Republic. Today it is a very special place&nbsp; beautiful in its own way &ndash; it is also known as cradle of architectural style constructionism and it`s monumental grey buildings set the rhythm to central streets. Thus the city is not grey &ndash; it has variety of thousand shades and colors creating a unique image.</p><p>Kharkiv is a city of youth because here is the largest concentration of educational institutions &ndash; 69 universities, institutes, academies and colleges, where more than 200,000 students are studying. They are giving huge positive vibes of energy and emotions and thanks to it our city is growing and moving faster and faster.</p><p>There are thre points to must visit:</p><p>The fisrt one:&nbsp;<strong>Pokrovsky Monastery</strong>&nbsp;was founded right after the city. On its territory you can visit Pokrovska and Ozeryanska church, and few associated buildings &ndash; bishop`s house, monk`s cells, Icon shop and little bakery with monastery goods. NB: women should wear skirts and cover the head with some cloth &ndash; can be taken in monastery security, men shouldn`t wear shorts.</p><p>The second one:&nbsp;<strong>Svobody square</strong>&nbsp;is one of the biggest squares in Europe and definitely the biggest in Ukraine was founded in 1923 few moments before start of constructing the main symbol of Kharkiv &ndash; the Gosprom of Derzhprom building. Today the place is never empty &ndash; city celebrations and concerts, fairs and markets, children playgrounds in summer. To feel the spirit of central point of the city is best while there`s something going on it &ndash; would it be a Victory parade on 9<sup>th</sup>&nbsp;of May or show of &ldquo;Queen&rdquo; which gathered in one place more than 350 thousand people&nbsp; and it was a record number for the group.</p><p>And the third one:&nbsp;<strong>Architect&rsquo;s square</strong>&nbsp;is situated alongside Pushkinskaia street next to Architectora Beketova station and here there are a few focuses of attention. One of them without any doubts is collection of Seven Wonders of Kharkiv &ndash; miniature copies of Kharkiv&rsquo;s outstanding buildings and monuments. Here are also the Fountain of Lovers and an Oak which is growing here for two hundred years.</p>', '', 'full_html'),
('node', 'city', 0, 80, 80, 'und', 0, '<p>Dnipropetrovsk is spread across both banks of the great Dnieper River, and is one the most colorful and interesting cities of eastern Ukrainian. In addition to being the largest industrial and economic center, it has the status of being Ukraine&rsquo;s space capital, and it is an extremely charming city, attracting visitors with its beautiful architecture, numerous parks, picturesque boardwalks, and precious historical memorials.</p><p>Dnepropetrovsk&rsquo;s history began in 1776, when Catherine the Great (on a trip through the region) ordered general Gregory Potiomkin to establish a city here. However, the city&rsquo;s construction did not begin until 1787. The building of the Transfiguration Cathedral started at the same time, when the empress herself set the first stone in the structure&rsquo;s foundation. The town, originally named Yekaterinoslav, was intended to become Russian Empire&rsquo;s third main city. But these plans were not to be: after Catherine the Great died, the city&rsquo;s construction and development slowed down considerably.</p><p>The city&rsquo;s fortunes changed only in the late 19th century, when Yekaterinoslav prospered, as large ores deposits were discovered and a railroad was built nearby. Soon, it became one of the Russian Empire&rsquo;s most important industrial centers. In 1926, Yekaterinoslav was renamed into Dnepropetrovsk: its new name was a combination of the Dnieper River and the name of the Soviet official Grigory Petrovsky.</p><p>Modern Dnipropetrovsk&nbsp;easily weaves together the rhythm of a fast-paced business center with the peaceful atmosphere of countless parks, in which local residents like to spend their time. But the most popular place to walk and rest is the beautiful Lenin Boardwalk, which happens to be the longest in Europe. It leads to most one of the most interesting of the city&rsquo;s landmarks, the legendary Monastyrsky Island. It is well established that in the 9th century, a Byzantine monastery stood here (which explains the island&rsquo;s name). At that time, a famous trade route between the Varangians and the Greeks passed through the Dnieper River, and the island was often used as a stopping point. The Old Russian princess Olga once waited for a storm to pass in a local monastery; and shortly after that, the prince Vladimir the Great rested within its walls. Today, Monastyrsky Islandis part of the largest park of &nbsp;Dnipropetrovsk -Shevchenko Park. In the park is a cableway, from which you can get amazing views of the city and the splendid St. Nickolay Church. The park is so splendid, that even the pedestrian bridge leading to the island is considered to be a landmark of its own.</p><p>Dnipropetrovsk&nbsp;main road, the Karl Marx Avenue, beckons visitors with its beautiful structures that have survived since the 19th century. Among them, the most notable are the buildings of the National University, the City Duma (Parliament) and the English Club, as well as the famous History Museum&nbsp;- one of the oldest in Ukraine. It is famous all over Ukraine for its impressive collection of antiquities and artifacts, which number over seven thousand. In the museum, a diorama called &quot;Battle of Dnieper,&quot; which recounts the events of World War II, will attract your attention, as will the collection of ancient stone sculptures, one of the largest and most impressive in the world. The age of some of sculptures goes back up to five thousand years!</p><p>The architectural pride of Dnipropetrovsk&nbsp;is rightly considered to be the Transfiguration Cathedral, the same one that has been there since the beginning of the city&rsquo;s history. The architect wanted for Dnepropetrovsk&rsquo;s church to exceed Rome&rsquo;s St. Peter&#39;s Cathedral in size. Even though the idea was not fulfilled, the Transfiguration Cathedral is still an incredible sight to see, due to its stern splendor and understated beauty. Today, it is not only one of the most breathtaking cultural buildings in the city, but is also its spiritual center.</p><p>Dnipropetrovsk attracts with its great harmony. Two centuries-old classical buildings stand comfortably next to modern &quot;high tech&quot; buildings. And the severity of industrial giants is subdued by the rich greenery of picturesque parks and boulevards. All of that, along with a unique historical and cultural heritage, creates an inimitable atmosphere that makes Dnipropetrovsk&nbsp;unlike any other city in the country, and attracts thousands of travelers from all over the world.</p>', '', 'full_html'),
('node', 'city', 0, 81, 81, 'und', 0, '<p><strong>Kiev is the&nbsp;capital of Ukraine with population of about 3 million citizens. It is situated on the Dnepr River and boasts architectural monuments that are recognized world treasures. Kiev is the largest cultural, scientific and industrial center of Ukraine, the place of religious pilgrimage and a very attractive tourist destination. Its beautiful landscapes, parks and gardens charm and captivate. Hospitable Ukrainians will be delighted to introduce Slavic culture to their foreign guests.&nbsp;</strong></p><p>Kiev is a city of invaluable historical and cultural monuments, a city of great events and outstanding people. Everyone will find there something especially interesting for himself.</p><p>The art and architecture of Kiev are considered world treasures. Many famous artists, poets and writers estimated the unique beauty of this city. The most renowned landmarks include: Cathedral of St. Sophia with outstanding mosaics and frescoes dating back to the 11th century; Kievo-Percherskaya Lavra featuring several monasteries and cathedrals; Golden Gate of Kiev, which date back to 1037; Ukrainian Baroque Church of St. Andrew; the magnificent 19th-century Cathedral of St. Vladimir; and many other attractions. Kiev is often referred to as &quot;the mother of all cities&quot; by Russians and Ukrainians. It is one of the oldest towns in Europe. In the historical center of Kiev you can feel the spirit of the past everywhere.</p><p>Kiev is distinguished for its rich cultural life. Theater lovers will find many theatres offering various theatrical programs. Most performances are held in Ukrainian or Russian. The recently renovated Kiev Opera House presents very good opera as well as a broad repertoire of ballets. Ivan Franko Theater is a center of Ukrainian drama, comedy, and musicals. A lot of various exhibitions are carried out in the city&#39;s numerous museums and art galleries.</p><p>Kiev is also a scientific and educational center of independent Ukraine. Various universities and science academies including famous Kiev-Mogilyanskaya Academy, which is one of the first scientific establishments in Eastern Europe, are located there.</p><p>Being the largest city of Ukraine, Kiev is a leading industrial and commercial center of the country. Kiev&#39;s major industries include: food processing (especially processing of beet sugar), metallurgy, manufacture of machinery, machine tools, rolling stock, chemicals, building materials, and textiles. The development of Ukrainian economy gave impulse to business activity of the city. There are a lot of new office centers, banks, trade exhibition centers and other commercial enterprises appearing in the city nowadays.</p><p>Take a walk through the ancient streets of this scenic city, feel its unique beauty and the spirit of its past. For sure your stay in Kiev will become one of your most memorable experiences.</p>', '', 'full_html'),
('node', 'article', 0, 82, 82, 'und', 0, '<p>Bible school activities have been used in various regions to teach children and teenagers the Word of God. Whether it is inside a comfortable building or simply sitting on a tarp on the ground, children have been encouraged and taught about Jesus.</p>', '', 'full_html'),
('node', 'article', 0, 83, 83, 'und', 0, '<p>Constructions teams partner with a group or existing body of believers to build a new hall or make renovations. &nbsp;Usually, US partners help supply manpower and materials for the project. &nbsp;New construction creates excitement not only for the body but for the community as well.</p>', '', 'full_html'),
('node', 'article', 0, 84, 84, 'und', 0, '<p>Several unreached people groups in Ukraine are being told about the Good News for the first time. &nbsp;IMB personnel are working among some of the hardest to reach and unloved people in all of Europe. &nbsp;In these cities, IMB missionaries are partnering with locals in order to reach them.</p>', '', 'full_html'),
('node', 'article', 0, 85, 85, 'und', 0, '<p>US Medical teams have been used throughout Ukraine with great success in the sheer numbers reached. &nbsp;Clinics are set up in existing churches or rented halls. &nbsp;Every person seen in the clinic is prayed for, clearly given the Good News and sent home with a New Testament if they don&#39;t have one. &nbsp;Typically, a clinic sees more than 75 people a day.</p>', '', 'full_html'),
('node', 'article', 0, 86, 86, 'und', 0, '<p>IMB missionaries are involved in a variety of ministries throughout Ukraine. &nbsp;The main task is to support the work of partners and the ministries entrusted to them. &nbsp;These include: starting small groups in existing churches and as an impetus to starting new churches; disciple making through Training for Trainers, Experiencing God and other resources; training and evangelism.</p><p>IMB missionaries are always looking for US partners to join in ministry opportunities in order to strengthen the local church or group. &nbsp;Here are just a few of the many ministries a US partner church could join in the harvest fields of Ukraine:</p>', '', 'full_html'),
('node', 'article', 0, 87, 87, 'und', 0, '<p>For 300 years Ukraine had been the part of Russian Empire and the Soviet Union of Socialist Republics.</p><p>During the Russian Empire times most people who lived in Ukraine were serfs and worked hard for food (it was actually slavary). At this time, Taras Shevchenko (famous Ukrainian poet and writer of that period) described all the horrors in his poems and encouraged people to fight against the existing regime till he was referred to hard labor.</p><p>Since 1919 Ukraine joined the USSR because the territory of Ukraine was strategically important with all available raw materials. There were rich deposits of coal, iron and ore in the East and fertile soil&nbsp;almost in all the regions except the South. Plants and factories were built in the East for manufacturing of these resources; KOLKHOZ (collective farms) were built on other territories for growing cattle to provide food for other parts of the Soviet Union. People from other republics often moved to the Eastern part of Ukraine due to the possibility to get a job on plants and factories.&nbsp;Therefore, most inhabitants of the East have many relatives in Russian Federation and have better memories about the USSR times. Instead, inhabitants of other parts of Ukraine worked in farms and didn&#39;t have&nbsp;such salaries as&nbsp;people who worked in&nbsp;plants (better paid for work in the plant). In addition due to the collectivization policy, farms were&nbsp;taken away from farmers and those farms&nbsp;were combined into collective farms (it was a forced process). Those who opposed to the collectivization were&nbsp;resettled in Siberia and most of them died on the way. Perhaps 5 million people were sent to forced labor camps. Also Soviet leadership used the man-made famine to attack Ukrainian nationalism.</p><p>During the Soviet Union times, national interests and culture of Ukrainians was under a&nbsp;serious pressure. Unquestioning faith in the Soviet leaders was&nbsp;implanted in people from their childhood (Vladimir Lenin, Josef Stalin). The&nbsp;Ukrainian dissidents were persecuted, Ukrainian language and religion was under a prohibition and indignity. That is why Ukrainian literature is closely related to the idea of national consciousness and the struggle for independency. A lot of literature and government figures were shot, sent to prison by the Communist Party because they had written the truth about actual life in the country.</p><p>In the Soviet Union above 40 mln people were depositors of the Sberbank (NATIONAL BANK&nbsp;of the USSR). When the&nbsp;Soviet Union collapsed in 1991, its&nbsp;national currency was depreciated and a lot of people were left with nothing. Many people became millionaires, but in fact they could not buy anything because prices were up by&nbsp;24 times and there was a terrible shortage of goods. However, some people still want to go back to the USSR - time of parades, no crimes, time of their youth. Density of population was comparably high in&nbsp;the East and in the South of Ukraine. They believed that social isolation had deprived them of such negative social phenomena as absence of crime, drug abuse and prostitution. Inhabitants of the USSR traveled only in the Soviet Union and could not see any exampes of people&#39;s&nbsp;lives&nbsp;abroad. And they easily believed they lived very well until the Soviet Union collapsed.</p><p>Ukraine gained its independence on August 24, 1991. After the so-called &#39;Iron Curtain&#39; fell in 1991 the inhabitants of the USSR were able to see the trueth that in some countries people were living much better and in some much worse. People got the opportunity to travel abroad&nbsp;but hardly anybody could afford it.</p><p>For a long time Russian culture had been a part of the Ukrainian culture, that is why cultural traditions and language of these countries are very similar. Before the Soviet Union collapsed the hospitality of the people was much better than nowadays, because almost everybody stood&nbsp;on the same social level. There was a so-called &quot;equalization&quot;, people believed in a bright future and worked with such an idea. After the collapsion,&nbsp;the country crisis and unemployment was flourishing, the level of crime&nbsp;increased, people had came to understanding that someone&#39;s lives was much better than theirs. This situation&nbsp;led to occuring such negative feelings as greed, envy, a sense of inferiority.</p><p>Even now poorer people envy richer because they believe that rich people have gained their wealth by a dishonest way. Poor&nbsp;people do not want to do something in order to live better. They blame state and the politicians (though there might be some&nbsp;reasons) or other people in their failures.</p><p>In 2013 Ukraine took the&nbsp;5th place in the number of alcoholics in the world (after Moldova, Hungary, Czech Republic and Russia). You can often hear on&nbsp;holidays men cheering and saying &quot;If you will not drink with me, then you don&#39;t respect me&quot;. The population got accustomed to drinking rather than facing and fighting against their problems. In Ukraine, people don&#39;t go to psychologists they meet up with friends to complain to their affairs with a bottle of drink. Sometimes you can see a man who fell and sleeps&nbsp;in the street and no one rushes to help him. Most of people in Ukraine will think that man is just very drunk. There is Ukrainian saying &quot;my house is at the end&quot; whcih would be an equivalent to &quot;none of my&nbsp;business&quot; and it means that a person who does not care about the problems of others.</p><p>The strongest desire of Ukrainians is to have more money than the neighbor has. Of course this is a joke but with a high degree of truth in it. In Ukraine it is a normal thing&nbsp;to ask for money in debt from relatives, friends, neighbors.</p><p>Since 1990s many Ukrainians have gone abroad in search of a work. But they are forced to work in hard working conditions because they don&#39;t know the language and have no rights in a foreign country. Ukrainians have been working on farms or taking care&nbsp;of elderly people&nbsp;or cleaning up houses. They returned to Ukraine with money but with acquired diseases and really exhausted. In their absence a wife/husband would find another family, kids would be distanced from&nbsp;the parents and&nbsp;families&nbsp;broke down.&nbsp;<br />Most Ukrainian can&#39;t get a good education, healthcare and housing. Students have to buy textbooks themselves in many schools because the state does not provide schools&nbsp;properly. Teacher isn&#39;t a prestigious profession in this country. It is very difficult to buy a house or appratment,&nbsp;that is why most Ukrainians have to rent it. Health Insurance is absent and some doctors can refuse a patient in a provision of medical aid if there is no&nbsp;cash payment (a bribe). Of course it&#39;s illegal but people have&nbsp;to pay because they cannot afford to defend their rights in a court. If a person is suffering from cancer or other hard diseases and he needs a lot of money for a surgery, this person would have&nbsp;two options how&nbsp;to get money: either to ask for financial help from a&nbsp;family, friends, strangers through the media, to beg in the streets or die.</p><p>Having survived two World Wars, famine, constant harassment from the Russian Empire and the communist party, our&nbsp;ancestry passed on&nbsp;true stories about their&nbsp;lives at those times. Probably it is a wonderful&nbsp;reason for the older generations to&nbsp;spend&nbsp;more time with younger generations.</p><p>Religion and language harassment have led to the loss of patriotic behaviors in Ukrainians. Although, in recent years Ukrainian patriotism has been reborn in people&#39;s minds and behaviours. Moreover,&nbsp;the presence of volunteers who are willing to defend Ukraine in the East proves the restoration of the patriotism. Performing of Ukrainian hymn in schools and wearing national dresses for the holidays are exapmles of it as well.&nbsp;Young people have begun to speak Ukrainian language, although most had spoken Russian earlier (in the West almost all speak Ukrainian, in the Center and North - both Ukrainian and Russian, in the East and South - Russian).</p><p>1 UAH - Vladimir the Great (Grand Prince of Kiev, first started Christianity in Kievan Rus)&nbsp;<br />2 UAH - Yaroslav the Wise (Kyiv Prince)<br />5 UAH - Bogdan Khmelnitsky (public and politician, head of the Cossack state)<br />10 UAH - Ivan Mazepa (public and politician, head of the Cossack state)<br />20 UAH - Ivan Franco (writer, poet, social and political activist)<br />50 UAH - Mykhailo Hrushevsky (politician)<br />100 UAH - Taras Shevchenko (poet, writer, painter, social and political activist)<br />200 UAH - Lesya Ukrainka (writer and cultural figure)<br />500 UAH - Hryhorii Skovoroda (philosopher, educator, poet)</p>', '', 'full_html'),
('node', 'article', 0, 88, 88, 'und', 0, '<p>Ukrainians are very hospitable people, that is why they are always trying to feed guests. &nbsp;Villagers are more hospitable. You can hurt a master of a home if being his guest you refuse from a proposed food. This might be viewed as arrogance. It&#39;s also desirable to finish all food on your plate so don&#39;t take more food that you can finish afterwards. Better to take smaller pieces of a dish and if you enjoy the taste you can take more later.</p><p>Traditional Ukrainian dishes are: borscht, varenyky, golubtsy, holodets and salo.</p><ul><li>Borscht is a soup made with beets, haricot bean, meat, potato, cabbage, onion, carrot, tomato.</li><li>Varenyky reminds a large dumpling with different fillings such as: cabbage, potato, potato mixed with mushrooms, cottage cheese and others.</li><li>Golubtsy is made of a cabbage leaf stuffed with grained meat and boiled rice. Golubtsy must be stewed with tomato and sour cream.&nbsp;</li><li>Holodets is a something like cold meat jello. It is usually cooked with pork shank.</li><li>Salo is made only from pig. There are a lot of sayings that Salo is one of the main and the most favourite food for Ukrainians.</li></ul><p>Daily food in a village differs from food in a city. Village people breed domestic animals so they often cook pork and poultry. Also all village people have a garden where they usually grow potatoes and other different vegetables. People from villages usually cook their meals using the vegetables from their gardens. Meals are balanced and tasty but can be very nourishing.</p><p>Almost all city folks buy their food in supermarkets, though some buy in markets. Fast-food resturants are becoming widespread in the cities and towns. But you need to be careful with food that you can buy an a street. You might have stomach ache, as such food isn&rsquo;t cooked under required sanitary conditions. Foreign visitors should note that if they go to a market to buy some meat they can always see medieval paintings inside of a market buildings, a pig head, ears and hooves. It is really fascinating.<br />Restaurants and caffes offer folks and guests meals of different cuisines: Ukrainian, Russian, Georgian, Italian, European, French and Japanese. Other well-known fast food restaurants such as McDonalds, KF&#39;s have already become popular in bigger cities. Nevertheless city folks still cook at home. They usually cook soups, cereals, salads and meat. For breakfasts Ukrainians usually drink coffee, black or green tea, eat a sandwich with cheese and sausage or eggs. But 60% of Ukrainians don&#39;t often have breakfast.</p><p>These kind of food is grown in Ukraine and used to make dishes:<br />Vegetables: potatoes, onions, carrots, cabbage, tomato, cucumber, celery, zucchini, pumpkin.<br />Meat: pork, chicken, beef.<br />Fish: carp, crucian carp, tench, bream, and catfish. Most part of Ukraine has not access to any seas that is why dishes contained seafood aren&rsquo;t popular.<br />Cereals and legumes: wheat, rye, oats, corn, peas, beans, buckwheat.<br />Fruits and berries: apples, pears, plums, apricots, cherries, sweet cherries, strawberries, raspberries, watermelon and grapes.<br />Herbs and spices: fennel, parsley, black pepper and basil.&nbsp;<br />Alcoholic beverages: beer, vodka, wine. Vodka is a very strong alcoholic drink (40%) made of cereals and alcohol, so it should be drunk with caution. Vodka analog has been made in some villages and called &quot;samogon&quot; (moonshine). It can be even stronger than vodka, and have taste of the product prepared from (beets, potatoes, sugar). The word &quot;samogon&quot; comes from two words &quot;samo&quot; - by himself and &quot;gon&quot; abbriviation from word that means the way to get alcohol from sugar or other products, word &ldquo;samogon&rdquo; means done independently. Time for alcohol selling is limited from 8:00 to 22:00 in Ukraine. Alcohol and tobacco aren&#39;t allowed to sell to persons under 18. But some are violating these rules of law still.</p><p>Ukrainian sugar is made from sweet beet and oil is made from sunflower.&nbsp;<br />The tap water in the cities is not recommended to use because it is process water and is harmful to health. Better to order water in companies that produce it (Alaska, etc.) or buy in the supermarket.</p><p>Ukrainian sayings and expressions that are concerned with food:&nbsp;<br />Bread is the head for everyhting - This expression is associated with fact that Ukrainians have deep respect for bread since ancient times. Most people in Ukraine will not eat a main dish without bread. This attitude towards bread is caused by the famine years that happened not once in the history of Ukraine.&nbsp;<br />Neither fish nor fowl - This expression describes a person who is not sure in his opinion or decisions.&nbsp;<br />Bathing like curd in butter (To live in clover) means that person lives in luxury, his life is just abundant.&nbsp;<br />Lick your paw - means a person didn&#39;t get what he expected to get, fail in something. It indicates a situation when you want something and don&#39;t get it so you just have to lick one&#39;s lips.&nbsp;<br />Apple doesn&#39;t fall far from the apple tree means that children are repeating shortcomings of their parents, and most of the times children remind their parents in actions and decisions.&nbsp;<br />I ate dog. This means that person is very experienced in something or very educated in a aprticular subject.&nbsp;<br />If I don&#39;t fully eat it then I&#39;ll bite off it means person don&#39;t want to share with anyone. Person can&#39;t take all but he doesn&rsquo;t want to share it neither.</p>', '', 'full_html');
