(85, 'node', ' medical clinic us medical teams have been used throughout ukraine with great success in the sheer numbers reached clinics are set up in existing churches or rented halls every person seen in the clinic is prayed for clearly given the good news and sent home with a new testament if they don t have one typically a clinic sees more than 75 people a day  ', 0),
(86, 'node', ' ministry throughout ukraine imb missionaries are involved in a variety of ministries throughout ukraine the main task is to support the work of partners and the ministries entrusted to them these include starting small groups in existing churches and as an impetus to starting new churches disciple making through training for trainers experiencing god and other resources training and evangelism imb missionaries are always looking for us partners to join in ministry opportunities in order to strengthen the local church or group here are just a few of the many ministries a us partner church could join in the harvest fields of ukraine  ', 0),
(87, 'node', ' history for 300 years ukraine had been the part of russian empire and the soviet union of socialist republics during the russian empire times most people who lived in ukraine were serfs and worked hard for food it was actually slavary at this time taras shevchenko famous ukrainian poet and writer of that period described all the horrors in his poems and encouraged people to fight against the existing regime till he was referred to hard labor since 1919 ukraine joined the ussr because the territory of ukraine was strategically important with all available raw materials there were rich deposits of coal iron and ore in the east and fertile soil almost in all the regions except the south plants and factories were built in the east for manufacturing of these resources kolkhoz collective farms were built on other territories for growing cattle to provide food for other parts of the soviet union people from other republics often moved to the eastern part of ukraine due to the possibility to get a job on plants and factories therefore most inhabitants of the east have many relatives in russian federation and have better memories about the ussr times instead inhabitants of other parts of ukraine worked in farms and didn t have such salaries as people who worked in plants better paid for work in the plant in addition due to the collectivization policy farms were taken away from farmers and those farms were combined into collective farms it was a forced process those who opposed to the collectivization were resettled in siberia and most of them died on the way perhaps 5 million people were sent to forced labor camps also soviet leadership used the manmade famine to attack ukrainian nationalism during the soviet union times national interests and culture of ukrainians was under a serious pressure unquestioning faith in the soviet leaders was implanted in people from their childhood vladimir lenin josef stalin the ukrainian dissidents were persecuted ukrainian language and religion was under a prohibition and indignity that is why ukrainian literature is closely related to the idea of national consciousness and the struggle for independency a lot of literature and government figures were shot sent to prison by the communist party because they had written the truth about actual life in the country in the soviet union above 40 mln people were depositors of the sberbank national bank of the ussr when the soviet union collapsed in 1991 its national currency was depreciated and a lot of people were left with nothing many people became millionaires but in fact they could not buy anything because prices were up by 24 times and there was a terrible shortage of goods however some people still want to go back to the ussr time of parades no crimes time of their youth density of population was comparably high in the east and in the south of ukraine they believed that social isolation had deprived them of such negative social phenomena as absence of crime drug abuse and prostitution inhabitants of the ussr traveled only in the soviet union and could not see any exampes of people s lives abroad and they easily believed they lived very well until the soviet union collapsed ukraine gained its independence on august 24 1991 after the socalled iron curtain fell in 1991 the inhabitants of the ussr were able to see the trueth that in some countries people were living much better and in some much worse people got the opportunity to travel abroad but hardly anybody could afford it for a long time russian culture had been a part of the ukrainian culture that is why cultural traditions and language of these countries are very similar before the soviet union collapsed the hospitality of the people was much better than nowadays because almost everybody stood on the same social level there was a socalled equalization people believed in a bright future and worked with such an idea after the collapsion the country crisis and unemployment was flourishing the level of crime increased people had came to understanding that someone s lives was much better than theirs this situation led to occuring such negative feelings as greed envy a sense of inferiority even now poorer people envy richer because they believe that rich people have gained their wealth by a dishonest way poor people do not want to do something in order to live better they blame state and the politicians though there might be some reasons or other people in their failures in 2013 ukraine took the 5th place in the number of alcoholics in the world after moldova hungary czech republic and russia you can often hear on holidays men cheering and saying if you will not drink with me then you don t respect me the population got accustomed to drinking rather than facing and fighting against their problems in ukraine people don t go to psychologists they meet up with friends to complain to their affairs with a bottle of drink sometimes you can see a man who fell and sleeps in the street and no one rushes to help him most of people in ukraine will think that man is just very drunk there is ukrainian saying my house is at the end whcih would be an equivalent to none of my business and it means that a person who does not care about the problems of others the strongest desire of ukrainians is to have more money than the neighbor has of course this is a joke but with a high degree of truth in it in ukraine it is a normal thing to ask for money in debt from relatives friends neighbors since 1990s many ukrainians have gone abroad in search of a work but they are forced to work in hard working conditions because they don t know the language and have no rights in a foreign country ukrainians have been working on farms or taking care of elderly people or cleaning up houses they returned to ukraine with money but with acquired diseases and really exhausted in their absence a wife husband would find another family kids would be distanced from the parents and families broke down most ukrainian can t get a good education healthcare and housing students have to buy textbooks themselves in many schools because the state does not provide schools properly teacher isn t a prestigious profession in this country it is very difficult to buy a house or appratment that is why most ukrainians have to rent it health insurance is absent and some doctors can refuse a patient in a provision of medical aid if there is no cash payment a bribe of course it s illegal but people have to pay because they cannot afford to defend their rights in a court if a person is suffering from cancer or other hard diseases and he needs a lot of money for a surgery this person would have two options how to get money either to ask for financial help from a family friends strangers through the media to beg in the streets or die having survived two world wars famine constant harassment from the russian empire and the communist party our ancestry passed on true stories about their lives at those times probably it is a wonderful reason for the older generations to spend more time with younger generations religion and language harassment have led to the loss of patriotic behaviors in ukrainians although in recent years ukrainian patriotism has been reborn in people s minds and behaviours moreover the presence of volunteers who are willing to defend ukraine in the east proves the restoration of the patriotism performing of ukrainian hymn in schools and wearing national dresses for the holidays are exapmles of it as well young people have begun to speak ukrainian language although most had spoken russian earlier in the west almost all speak ukrainian in the center and north both ukrainian and russian in the east and south russian 1 uah vladimir the great grand prince of kiev first started christianity in kievan rus 2 uah yaroslav the wise kyiv prince 5 uah bogdan khmelnitsky public and politician head of the cossack state 10 uah ivan mazepa public and politician head of the cossack state 20 uah ivan franco writer poet social and political activist 50 uah mykhailo hrushevsky politician 100 uah taras shevchenko poet writer painter social and political activist 200 uah lesya ukrainka writer and cultural figure 500 uah hryhorii skovoroda philosopher educator poet  ', 0),
(88, 'node', ' learn about ukrainian food ukrainians are very hospitable people that is why they are always trying to feed guests villagers are more hospitable you can hurt a master of a home if being his guest you refuse from a proposed food this might be viewed as arrogance it s also desirable to finish all food on your plate so don t take more food that you can finish afterwards better to take smaller pieces of a dish and if you enjoy the taste you can take more later traditional ukrainian dishes are borscht varenyky golubtsy holodets and salo borscht is a soup made with beets haricot bean meat potato cabbage onion carrot tomato varenyky reminds a large dumpling with different fillings such as cabbage potato potato mixed with mushrooms cottage cheese and others golubtsy is made of a cabbage leaf stuffed with grained meat and boiled rice golubtsy must be stewed with tomato and sour cream holodets is a something like cold meat jello it is usually cooked with pork shank salo is made only from pig there are a lot of sayings that salo is one of the main and the most favourite food for ukrainians daily food in a village differs from food in a city village people breed domestic animals so they often cook pork and poultry also all village people have a garden where they usually grow potatoes and other different vegetables people from villages usually cook their meals using the vegetables from their gardens meals are balanced and tasty but can be very nourishing almost all city folks buy their food in supermarkets though some buy in markets fastfood resturants are becoming widespread in the cities and towns but you need to be careful with food that you can buy an a street you might have stomach ache as such food isn t cooked under required sanitary conditions foreign visitors should note that if they go to a market to buy some meat they can always see medieval paintings inside of a market buildings a pig head ears and hooves it is really fascinating restaurants and caffes offer folks and guests meals of different cuisines ukrainian russian georgian italian european french and japanese other wellknown fast food restaurants such as mcdonalds kf s have already become popular in bigger cities nevertheless city folks still cook at home they usually cook soups cereals salads and meat for breakfasts ukrainians usually drink coffee black or green tea eat a sandwich with cheese and sausage or eggs but 60 of ukrainians don t often have breakfast these kind of food is grown in ukraine and used to make dishes vegetables potatoes onions carrots cabbage tomato cucumber celery zucchini pumpkin meat pork chicken beef fish carp crucian carp tench bream and catfish most part of ukraine has not access to any seas that is why dishes contained seafood aren t popular cereals and legumes wheat rye oats corn peas beans buckwheat fruits and berries apples pears plums apricots cherries sweet cherries strawberries raspberries watermelon and grapes herbs and spices fennel parsley black pepper and basil alcoholic beverages beer vodka wine vodka is a very strong alcoholic drink 40 made of cereals and alcohol so it should be drunk with caution vodka analog has been made in some villages and called samogon moonshine it can be even stronger than vodka and have taste of the product prepared from beets potatoes sugar the word samogon comes from two words samo by himself and gon abbriviation from word that means the way to get alcohol from sugar or other products word samogon means done independently time for alcohol selling is limited from 800 to 2200 in ukraine alcohol and tobacco aren t allowed to sell to persons under 18 but some are violating these rules of law still ukrainian sugar is made from sweet beet and oil is made from sunflower the tap water in the cities is not recommended to use because it is process water and is harmful to health better to order water in companies that produce it alaska etc or buy in the supermarket ukrainian sayings and expressions that are concerned with food bread is the head for everyhting this expression is associated with fact that ukrainians have deep respect for bread since ancient times most people in ukraine will not eat a main dish without bread this attitude towards bread is caused by the famine years that happened not once in the history of ukraine neither fish nor fowl this expression describes a person who is not sure in his opinion or decisions bathing like curd in butter to live in clover means that person lives in luxury his life is just abundant lick your paw means a person didn t get what he expected to get fail in something it indicates a situation when you want something and don t get it so you just have to lick one s lips apple doesn t fall far from the apple tree means that children are repeating shortcomings of their parents and most of the times children remind their parents in actions and decisions i ate dog this means that person is very experienced in something or very educated in a aprticular subject if i don t fully eat it then i ll bite off it means person don t want to share with anyone person can t take all but he doesn t want to share it neither  ', 0);
